import React, {useEffect} from "react"
import { useNavigate } from "react-router";
import { CurrentUserPosts } from ".";
import "./Profile.css"
import { SentMessages } from ".";

const Profile = ({isLoggedIn, currentUser, token, posts, setPosts, currentUserPosts, setCurrentUserPosts, currentUserSentMessages, setCurrentUserSentMessages}) => {
  const navigate = useNavigate()
  console.log(currentUser)

  useEffect(() => {
    if (!isLoggedIn) navigate('/login')
  }, [])

  return <>
    <div className='userGreeting'><b>{`Hello ${currentUser}.`}</b></div>
    <div className='userDetailsContainer'>
      <div className='userMessageHeader'>
      <div className='header'>Your Messages</div>
        <div>Messages Recieved:</div> 
        <div>Messages Sent:</div>
        <SentMessages isLoggedIn={isLoggedIn} token={token} currentUser={currentUser} posts={posts} setPosts={setPosts} currentUserPosts={currentUserPosts} setCurrentUserPosts={setCurrentUserPosts} currentUserSentMessages={currentUserSentMessages} setCurrentUserSentMessages={setCurrentUserSentMessages}/>
     </div>
      <div className='userPostHeader'>
        <div className='header'>Your Posts</div>
      <CurrentUserPosts token={token} currentUser={currentUser} posts={posts} setPosts={setPosts} currentUserPosts={currentUserPosts} setCurrentUserPosts={setCurrentUserPosts}/>
      </div>
    </div>
  </>
}

export default Profile;
